import React from 'react';

const ReturnsTable = ({ returns }) => {
    return (
        <table border="1">
            <thead>
                <tr>
                    <th>Currency</th>
                    <th>Return</th>
                </tr>
            </thead>
            <tbody>
                {Object.entries(returns).map(([currency, value]) => (
                    <tr key={currency}>
                        <td>{currency}</td>
                        <td style={{ color: value >= 0 ? 'green' : 'red' }}>
                            {value >= 0 ? '+' : ''}${value.toFixed(2)}
                        </td>
                    </tr>
                ))}
            </tbody>
        </table>
    );
};

export default ReturnsTable;
